var score = 0
var term = 0;
var randomImgList = [];
function RamdomImages(){
    for (var i = 0; i < imgList.length; i++) {
        var randomNum = Math.floor(Math.random() * (imgList.length - 1));
        term = imgList[i];
        imgList[i] = imgList[randomNum];
        imgList[randomNum] = term;
        }
}
var divs;
RamdomImages()
function GenerateImages() {
    imgList.forEach(myFunc);
        function myFunc(value, index, array) {
            divs = $(`<div class='divs'><button class = 'imgButton'><img src='${value}'/></button></div>`);
            $(".container").append(divs);
        }
}
GenerateImages();
var imgItems = $("img");
imgItems.addClass("match");
function setTimer() {
    setTimeout(function() {
        var timer = 30;
        var id = setInterval(function() {
        timer--;
        $(".timer").text(timer);
        if (timer >= 0 && $(".match").length == 0) {
          $(".container").html("<h1>You win!!</h1>");
          score +=1
          $('.score span').text(score)
          $(".btn").css("display", "block");
          clearInterval(id);
        }
        if (timer == 0 && $(".match").length != 0) {
          $(".container")
            .empty()
            .html("<h1>You lose!!</h1>");
          $(".btn").css("display", "block");
          score = 0
          $('.score span').text(score)
          clearInterval(id);
        }
        if (timer > 10) {
          $(".timer").css({ "background-color": "rgb(8, 189, 8)" });
        }
        if (timer == 10) {
          timer--;
          $(".timer").css({ "background-color": "red" });
        }
      }, 1000);
    }, 2000);
  }
setTimer();
function hideImg() {
    setTimeout(function() {
        $("img").animate({ opacity: "0" });
    }, 2000);
}
hideImg();
var divElem = $(".divs");
function clickDivs() {
    $(".imgButton").click(function() {
      var imag = $(this).children();
      imag.animate({ opacity: "1" });
      imag.addClass("selected");
      if ($(".selected").length == 2) {
        var selectedImage = $(".selected");
        if (
          selectedImage.first().attr("src") ==
          selectedImage.last().attr("src")
        ) {
          selectedImage.each(function() {
            $(this).parents('.imgButton').attr('disabled' , true)
            $(this)
              .animate({ opacity: "1" })
              .removeClass("selected")
              .removeClass("match");
          });
        } else {
          setTimeout(function() {
            selectedImage.each(function() {
              $(this)
                .animate({ opacity: "0" })
                .removeClass("selected");
            }, 2000);
          });
        }
      }
    });
}
clickDivs();
$(".btn").click(function() {
    $(this).css("display", "none");
    RamdomImages()
    timer = 0
    setTimer();
    $("h1").css("display", "none");
    GenerateImages();
    $("img").addClass("match");
    hideImg();
    clickDivs();
});
